    return(
        <Row xs={1} md={2} className="g-4">
  {Array.from({ length: 4 }).map((_, idx) => (
    <Col className='' md={12} lg={6}>
      <Card style={colors[1]}>
        <Card.Img variant="top" src="holder.js/100px160" />
        <Card.Body>
          <Card.Title>{props.Title}</Card.Title>
          <Card.Text>
            {props.Content}
          </Card.Text>
        </Card.Body>
      </Card>
    </Col>
  ))}
</Row>
    );
}

export default ColoredBoxSet;
